import React from 'react'
import Grid from '@mui/material/Unstable_Grid2';
import Box from '@mui/material/Box';
import Nav from './Nav';
import Dashboard from './Dashboard'

const Home = () => {
  return (
    <div>
      <Box>
        <Grid container>
          <Grid xs={3}>
            <Nav/>
          </Grid>
          <Grid xs={9}>
            <Dashboard/>
          </Grid>
        </Grid>
      </Box>
    </div>
  )
}

export default Home
